import React, { useState, useEffect } from 'react';
import './UserForm.css';

const UserForm = ({ onSubmit, initialData, onCancel }) => {
  const [formData, setFormData] = useState({
    firstName: '',
    middleName: '',
    lastName: '',
    dateOfBirth: '',
    gender: '',
    identification: { number: '', type: '', expiration: '', country: '' },
    vehicle: { plateNumber: '', type: '', make: '', model: '', year: '' },
    verified: false,
  });

  useEffect(() => {
    if (initialData) setFormData(initialData);
  }, [initialData]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    const [parent, child] = name.split('.');

    if (child) {
      setFormData((prev) => ({
        ...prev,
        [parent]: { ...prev[parent], [child]: value },
      }));
    } else {
      setFormData((prev) => ({ ...prev, [name]: value }));
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(formData);
  };

  return (
    <div className="form-container">
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>First Name:</label>
          <input
            type="text"
            className="form-control"
            name="firstName"
            value={formData.firstName}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Last Name:</label>
          <input
            type="text"
            className="form-control"
            name="lastName"
            value={formData.lastName}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Date of Birth:</label>
          <input
            type="date"
            className="form-control"
            name="dateOfBirth"
            value={formData.dateOfBirth}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Gender:</label>
          <select
            className="form-control"
            name="gender"
            value={formData.gender}
            onChange={handleChange}
          >
            <option value="">Select</option>
            <option value="M">Male</option>
            <option value="F">Female</option>
            <option value="O">Other</option>
          </select>
        </div>
        <h4>Identification</h4>
        <div className="form-group">
          <label>Number:</label>
          <input
            type="text"
            className="form-control"
            name="identification.number"
            value={formData.identification.number}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Type:</label>
          <input
            type="text"
            className="form-control"
            name="identification.type"
            value={formData.identification.type}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Expiration:</label>
          <input
            type="date"
            className="form-control"
            name="identification.expiration"
            value={formData.identification.expiration}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Country:</label>
          <input
            type="text"
            className="form-control"
            name="identification.country"
            value={formData.identification.country}
            onChange={handleChange}
          />
        </div>
        <h4>Vehicle</h4>
        <div className="form-group">
          <label>Plate Number:</label>
          <input
            type="text"
            className="form-control"
            name="vehicle.plateNumber"
            value={formData.vehicle.plateNumber}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Type:</label>
          <input
            type="text"
            className="form-control"
            name="vehicle.type"
            value={formData.vehicle.type}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Make:</label>
          <input
            type="text"
            className="form-control"
            name="vehicle.make"
            value={formData.vehicle.make}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Model:</label>
          <input
            type="text"
            className="form-control"
            name="vehicle.model"
            value={formData.vehicle.model}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Year:</label>
          <input
            type="text"
            className="form-control"
            name="vehicle.year"
            value={formData.vehicle.year}
            onChange={handleChange}
          />
        </div>
        <button type="submit" className="btn btn-primary">
          Save
        </button>
        {onCancel && (
          <button type="button" className="btn btn-secondary" onClick={onCancel}>
            Cancel
          </button>
        )}
      </form>
    </div>
  );
};

export default UserForm;
